// src/App.js
import React, { useState } from 'react';
import Layout from './components/Layout';
import LeftSidebar from './components/LeftSidebar';
import RightSidebar from './components/RightSidebar';
import Home from './pages/Home';

function App() {
  const [selectedModel, setSelectedModel] = useState(null);
  const [view, setView] = useState('home'); // 'home' or 'network'

  const handleSelectHome = () => setView('home');
  const handleSelectNetwork = () => setView('network');

  return (
    <Layout
      header={<h1>Conceptual Models Explorer</h1>}
      sidebarLeft={
        <LeftSidebar
          onSelectHome={handleSelectHome}
          onSelectNetwork={handleSelectNetwork}
        />
      }
      main={
        view === 'home' ? (
          <Home selectedModel={selectedModel} onSelectModel={setSelectedModel} />
        ) : (
          <p style={{ color: '#ccc' }}>Network Map Placeholder</p> // Replace with NetworkMap later
        )
      }
      sidebarRight={
        <RightSidebar
          models={[]} // Pass the sorted models if needed
          onSelectModel={setSelectedModel}
        />
      }
      footer={
        <p>
          All information belongs to the respective authors. Portions of this
          content were generated using AI and may contain inaccuracies. Verify
          against original sources.
        </p>
      }
    />
  );
}

export default App;
